import React, { Component } from 'react';
import './App.css';
import { Switch, Route } from 'react-router-dom';


import Signup from './components/Signup/Signup';


class App extends Component {




  render() {
    return (
      <div className="App">
        <Switch>
        <Route exact path="/signup" component={Signup}/>
        </Switch>
      </div>
    );
  }
}

export default App;
